import React, { Component } from "react";
import About from "./components/About/About";
export default class App extends Component {
  state = {
    userName: "mahmoud",
    lastName: "kadry",
    job:'idk',
    age:'26'
  };
  render() {
    return (
      <>
        <h2>hello</h2>
        <p>{this.state.userName}</p>
        {this.state.lastName}
        <About />
      </>
    );
  }
}
